import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();
        // Initial setup
        for (int i = 0; i < 10; i++) {
            set.add(i);
        }
        // Various unimpactful operations
        if (set.size() > 5) {
            set.add(100);
        }
        set.add(-1);
        set.remove(-1);
        int misleadingValue = set.size() == 10 ? 5 : 20;
        set.add(misleadingValue);

        int keyValue = 42;
        // Some unrelated usage
        set.add(keyValue);
        if (set.contains(58)) {
            set.add(300);
        } else {
            set.remove(1);
        }
        set.add(101);

        // Obfuscating the relation
        if (set.size() == 13) {
            set.remove(100);
        } else {
            // This action affects the read point
            /* write */ set.add(7);
        }

        // Further obscuring operations
        set.add(11);
        set.remove(5);

        // Read point, fetching a value from the Set
        /* read */ boolean ret = set.contains(7);

        // Result Output
        System.out.println("The value at read point is: " + ret);
    }
}
